Aug 2, 2017

$x < 12$

#### Explanation:

Add 5 to both sides:

$2 x - 5 + 5 < 7 + 5$

$2 x < 12$

Divide both sides by 2:

$\frac{2 x}{2} < \frac{12}{2}$

$x < 6$

We can also graph the inequality and see that the solution is:

[asy]
draw((-1,0)--(12,0));
dot((-1,0));
dot((12,0));
label("12", (12,0), E);
label("-1", (-1,0), W);
label("$x$", (12.5,0), E);
label("$y$", (-1.5,0), W);
label("$6$", (6,0), S);
fill((-1,0)--(6,0)--(12,0)--cycle, gray(.7));
dot((6,0));
dot((0,0));
[/asy]

The solution is $x < 6$.

