The order of operations says that we must perform the multiplication and division before we perform the subtraction.  Recall that $\frac{a}{b}\cdot\frac{c}{d}=\frac{ac}{bd}$.  We get \begin{align*}
\frac{-4}{28}\cdot\frac{7}{-2}&=\frac{(-4)\cdot7}{28\cdot(-2)}\\
&=\frac{28}{28\cdot(-2)}\\
&=\frac{28}{-56}\\
&=\boxed{-\frac{1}{2}}.
\end{align*}. The answer is -\frac{1}{2}

