First, we simplify the fraction (-6)/(-5).  Since the numerator and denominator have a common factor of 3, we can simplify to get (-6)/(-5) = 2/5.

Now we multiply 2/5 by the other fraction.  Recall that when we multiply fractions, we multiply the numerators together and the denominators together.  We get  \begin{align*}
\frac{2}{5} \cdot \frac{-210}{-336} &= \frac{2 \cdot (-210)}{5 \cdot (-336)}\\
&= \frac{-420}{-1680} = \frac{-420}{-2^8 \cdot 70} \\
&= \frac{2^2 \cdot 3 \cdot 5 \cdot (-7)}{2^8 \cdot 5 \cdot (-7)} \\
&= \frac{2^2 \cdot 3}{2^8} = \frac{3}{2^6} = \frac{3}{64}.
\end{align*}

We can simplify further by multiplying the numerator and denominator by $\sqrt{2}$, which gives us $\frac{3\sqrt{2}}{32}$.  However, this is not one of our answer choices, so we must leave our answer in the form $\frac{3}{64}$.  Thus, the answer is $\boxed{\frac{3}{64}}$. The answer is \frac{3}{64}

