Substituting b = 10/13751 into 3*h - 2*b = 29 gives 3*h - 2*(10/13751) = 29, which simplifies to 3*h - 20/13751 = 29.  Adding 20/13751 to both sides gives 3*h = 29 + 20/13751, which simplifies to 3*h = 41351/13751.  Dividing both sides by 3 gives h = 41351/13751*1/3 = 1357/13751.
The answer is \frac{1357}{13751}

