\sqrt{5694908} = \sqrt{2^2}\cdot\sqrt{7^2}\cdot\sqrt{17^2}\cdot\sqrt{82^2}\cdot\sqrt{154^2}
\] which is equal to $2\cdot7\cdot17\cdot82\cdot154 = 2\cdot7\cdot17\cdot(41\cdot2)\cdot(153\cdot2) = 2^6\cdot7\cdot17\cdot41\cdot153$.  Since $2^6 = 64$ and $153$ is between $63$ and $125$, we see that the answer is $\sqrt{64\cdot63\cdot153} = \sqrt{64}\sqrt{63}\sqrt{153} = \boxed{8\cdot63\cdot125}$. The answer is 8\cdot63\cdot125
